import React from 'react';
import '../styles/homepage.scss';
import Menu from '../reusable/Menu';
import { Switch, Route } from 'react-router-dom';
import Hats from '../reusable/Hats';
import Jackets from '../reusable/Jackets';
import Sneakers from '../reusable/Sneakers';
import Womens from '../reusable/Womens';
import Mens from '../reusable/Mens';

const HomePage = () => {
    return (
        <div className="homepage">
            <Menu/>
            <Switch>
                <Route path="/shop/hats" component={Hats}/>
                <Route path="/shop/jackets" component={Jackets}/>
                <Route path="/shop/sneakers" component={Sneakers}/>
                <Route path="/shop/womens" component={Womens}/>
                <Route path="/shop/mens" component={Mens}/>
            </Switch>
        </div>
    );
}

export default HomePage;
